const Admin = ({ navigation }) => {
  return (
    <View style={styles.h1}>
      <Text style={styles.text}>Bem vindo</Text>
      <Button
        title="Iniciar"
        onPress={() => navigation.goBack()}
      />
    </View>
  );
};



const styles = StyleSheet.create({
  container: {
    backgroundColor:'white',
    flex: 10,
    justifyContent: 'center',
    alignItems: 'center',
  },
  text: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  h1:{
    marginTop: 10,
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'black',
    height: 200, 
  }
});
